import styled from 'styled-components';

export const HomeHeader = () => {
  return (
    <div>
      <Header>
        <Title>lachambre online store</Title>
        <Subtitle>
          <p>Brand</p>
          <p>Allitems</p>
          <p>about</p>
          <p>contucts</p>
        </Subtitle>
      </Header>
    </div>
  );
};
const Header = styled.header`
  background-color: #ffb6c1;
  width: 100%;
  margin-top: 0%;
  padding: 0%;
`;

const Title = styled.h1`
  margin-top: 0;
  font-size: 30px;
  color: aliceblue;
`;

const Subtitle = styled.div`
  display: flex;
  gap: 16px;
  justify-content: center;
  margin-top: 0px;
  color: aliceblue;
`;
